{'sdk_element_id': 'BT-300-Procedure', 'sdk_element_title': 'Additional Information', 'sdk_element_xpath': '/*/cac:ProcurementProject/cbc:Note', 'test_data_xpaths': [{'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856d9090eed3deccd14a', 'test_data_id': 't01_PRT', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'Some additional information on the procurement ... blablabla'}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856d9090eed3deccd14c', 'test_data_id': 'pin-buyer_24', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': "Si richiede ad eventuali operatori economici che dispongano di soluzioni che ottemperino in maniera equivalente ai requisiti tecnici e prestazionali sopra indicati di presentare adeguata documentazione tecnico-scientifica entro e non oltre le ore 12:00 del giorno 23.4.2020 al seguente indirizzo e-mail: protocollo@pec.hsanmartino.it. Indicando: — gli estremi del mittente (ragione/denominazione sociale), indirizzo, numero di telefono, fax ed indirizzo di posta elettronica ove inviare eventuali comunicazioni, — la dicitura: «fornitura di materiale dedicato a ventilatore polmonare mod. Monnal T75». Il termine per la presentazione della documentazione è tassativo. Qualora entro il termine stabilito un concorrente presenti più plichi, gli stessi sono numerati secondo l'ordine di presentazione e verrà considerato valido soltanto l'ultimo. Per eventuali chiarimenti rivolgersi al responsabile del procedimento: — sig.ra Paola Rovegno — tel. +39 0105552612; paola.rovegno@hsanmartino.it, — dott.ssa Michela Mattera — +39 0105553063; michela.mattera@hsanmartino.it."}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856d9090eed3deccd14d', 'test_data_id': 'pin-buyer_24_published', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': "Si richiede ad eventuali operatori economici che dispongano di soluzioni che ottemperino in maniera equivalente ai requisiti tecnici e prestazionali sopra indicati di presentare adeguata documentazione tecnico-scientifica entro e non oltre le ore 12:00 del giorno 23.4.2020 al seguente indirizzo e-mail: protocollo@pec.hsanmartino.it. Indicando: — gli estremi del mittente (ragione/denominazione sociale), indirizzo, numero di telefono, fax ed indirizzo di posta elettronica ove inviare eventuali comunicazioni, — la dicitura: «fornitura di materiale dedicato a ventilatore polmonare mod. Monnal T75». Il termine per la presentazione della documentazione è tassativo. Qualora entro il termine stabilito un concorrente presenti più plichi, gli stessi sono numerati secondo l'ordine di presentazione e verrà considerato valido soltanto l'ultimo. Per eventuali chiarimenti rivolgersi al responsabile del procedimento: — sig.ra Paola Rovegno — tel. +39 0105552612; paola.rovegno@hsanmartino.it, — dott.ssa Michela Mattera — +39 0105553063; michela.mattera@hsanmartino.it."}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856d9090eed3deccd14f', 'test_data_id': 'CEI', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': "This CEI must be read in conjunction with its annexes, which are either to be filled in by the applicant, or provided for information purposes or for later submission.
— the annexes to be filled in are:
—— Annex I — Application Form;
