Interested experts may submit their applications at any point in time until 3 months before the list expires. It is, however, recommended that applications be submitted as early as possible."}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856d9090eed3deccd152', 'test_data_id': 'pin-cfc_25', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'a) Der Auftraggeber ist ausschließlich Sektorenauftraggeber nach § 100 Abs. 1 Nr. 2 GWB. b) Hinweise zum Verfahrensablauf: In der 1. Phase der Interessenbekundung haben Unternehmen zunächst nur allgemein ihr Interesse an der Teilnahme am Vergabeverfahren zu bekunden. Der Auftraggeber hat hierfür ein Formblatt erstellt. Das Formblatt kann nach Ziffer I.3 der vorliegenden Bekanntmachung abgerufen werden. Die Interessenbekundungen müssen in Textform über die Vergabeplattform des Auftraggebers bis zum Schlusstermin für deren Eingang nach Ziffer IV.2.2) eingehen. Eine Interessenbekundung als Bewerbergemeinschaft ist möglich. Die Einreichung der Eignungsunterlagen (entsprechend dem Teilnahmeantrag) ist in dieser Phase nicht erforderlich. Ein Unternehmen, das sein Interesse in der 1. Phase nicht bekundet hat, kann im weiteren Verlauf des Vergabeverfahrens nicht berücksichtigt werden. Der Auftraggeber wird in der 2. Phase des Vergabeverfahrens die Unternehmen, die frist- und formgerecht eine Interessenbekundung eingereicht haben, auffordern ihr Interesse zu bestätigen (Interessensbestätigung), in dem die in der entsprechenden Aufforderung aufgeführten Eignungsunterlagen eingereicht werden (Teilnahmeantrag). Eine Bewerbergemeinschaft kann in dieser Phase nur noch mit Unternehmen gebildet werden, die zur Interessenbestätigung aufgefordert wurden. In der Aufforderung zur Interessenbestätigung werden die für die Teilnahme maßgeblichen Informationen mitgeteilt werden. In der 3. Phase werden die erfolgreichen Bewerber zur Angabe eines Angebots aufgefordert. Der Auftraggeber behält sich nach § 15 Abs. 4 SektVO vor, den Auftrag auf der Grundlage der Erstangebote zu vergeben, ohne in Verhandlungen einzutreten. c) Die in Ziffer II.2.7) und in Ziffer IV.2.3) enthaltenen Zeitangaben stehen unter dem Vorbehalt der Anpassung und Aktualisierung. d) Fragen zum Vergabeverfahren sind elektronisch in Textform über die eVergabe-Plattform gem. Ziffer I.3 einzureichen. Fragen sind rechtzeitig gestellt, wenn sie bis spätestens zum 20.3.2020 eingegangen sind. e) Der Auftraggeber behält sich vor, bei Unterschreitung der Mindestzahl von drei zulassungsfähigen Bewerbungen das vorliegende Vergabeverfahren einzustellen. Der Auftraggeber behält sich zudem vor, bei einer Unterschreitung der Mindestzahl von drei wertungsfähigen Angeboten das vorliegende Vergabeverfahren einzustellen. Bei einer losweisen Vergabe gelten die voranstehenden Vorbehalte für jedes Los.'}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856e9090eed3deccd156', 'test_data_id': 'pin-only_24_maximal', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'Additional information ---'}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856e9090eed3deccd158', 'test_data_id': 'pin-only_fin-reg', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'Noteblablabla'}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856e9090eed3deccd159', 'test_data_id': 'pin-only_81', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'The authority reserves the right to amend any condition related to security of information to reflect any changes in national law or government policy. If any contract documents are accompanied by instructions on safeguarding classified information (e.g. a Security Aspects Letter), the authority reserves the right to amend the terms of these instructions to reflect any changes in national law or government policy, whether in respect of the applicable protective marking scheme, specific protective markings given, the aspects to which any protective marking applies or otherwise. The link below to the Gov.uk website provides information on the Government Security Classification. https://www.gov.uk/government/publications/government-security-classifications Advertising regime OJEU: This contract opportunity is published in the Official Journal of the European Union (OJEU), the MoD Defence Contracts Bulletin and www.contracts.mod.uk Go reference: GO-2020416-DCB-16375622'}]}, {'test_data_suite_oid': '6809856d9090eed3deccd148', 'test_data_suite_id': 'sdk_examples_pin-1.9', 'test_data_oid': '6809856e9090eed3deccd15e', 'test_data_id': 'pin-only_24', 'xpaths': [{'xpath': 'PriorInformationNotice/cac:ProcurementProject/cbc:Note', 'value': 'Noteblablabla'}]}], 'is_covered': True, 'xpath_conditions': [{'xpath_condition': '', 'meets_xpath_condition': True}], 'message': None}
